
import React from 'react';
import { View, Button, Alert } from 'react-native';
import RNHTMLtoPDF from 'react-native-html-to-pdf';
import RNFS from 'react-native-fs';

const   Pdf_cert = () => {
  const generatePDFWithImageWatermark = async () => {
    try {
      // Path to watermark image (base64 or URL)
     // const watermarkImage = 'https://example.com/watermark.png'; // Replace with your image URL or base64 data
     const watermarkImage = 'data:image/png;base64,';
      // Define HTML content with watermark image
      const htmlContent = `
        <div style="font-family: Arial, sans-serif; color: #333; position: relative;">
          <!-- Watermark Image -->
          <img src="${watermarkImage}" alt="Watermark" style="
            position: absolute;
            top: 50%;
            left: 2s0%;
       
            width: 400px;
            opacity: 0.1;
            z-index: -1;" />

          <!-- Main Document Content -->
          <h1 style="text-align: center; color: #333;">Professional Document</h1>
          <p style="text-align: center; font-size: 18px;">Generated with React Native</p>
          
          <div style="margin-top: 50px; padding: 0 20px; line-height: 1.6;">
            <p>This is a professionally generated document that includes an image watermark.</p>
            <p style="margin-top: 10px;">This can be used as an official document for your business or personal needs.</p>
          </div>
        </div>
      `;

      // PDF options
      const options = {
        html: htmlContent,
        fileName: 'document_with_image_watermark',
        directory: 'Documents',
      };

      // Generate PDF
      const file = await RNHTMLtoPDF.convert(options);

      // Show success alert
      Alert.alert('PDF Created', `PDF saved to: ${file.filePath}`);
    } catch (error) {
      console.error('Error creating PDF:', error);
      Alert.alert('Error', 'Could not create PDF. Please try again.');
    }
  };

  return (
    <View style={{ flex: 1, justifyContent: 'center', alignItems: 'center' }}>
      <Button title="Generate PDF with Image Watermark" onPress={generatePDFWithImageWatermark} />
    </View>
  );
};

export default   Pdf_cert;
